angular.module("shoppinpal.mobile-menu", []).run(["$rootScope", "$spMenu", function (a, b) {
	a.$spMenu = b
}]).provider("$spMenu", function () {
	this.$get = [function () {
		var a = {};
		return a.show = function () {
			var a = angular.element(document.querySelector("#sp-nav"));
			console.log(a), a.addClass("show")
		}, a.hide = function () {
			var a = angular.element(document.querySelector("#sp-nav"));
			a.removeClass("show");
		}, a.toggle = function () {
			var a = angular.element(document.querySelector("#sp-nav"));
			$('#sp-page').css('z-index', 999);  
			 //$('#sp-page').css('display', 'none');  
			 console.log( $("#sp-page"));
			 a.toggleClass("show");
			}, a
		}]
	});
